import { Form, Icon, Input, Button,Row,
  Col, Checkbox ,Drawer} from 'antd';
import React from 'react';
import {login} from "../../middleware/users"
import {WrappedSignin }from "../Signin/Signin"

class Login extends React.Component {
  handleSubmit = e => {
    e.preventDefault();
    this.props.form.validateFields((err, values) => {
      if (!err) {
        let response=login(values)
      }
    });
  };
  showSigninDrawer = () => {
    this.setState({
      signinVisible: true,
    });
  };
  onSigninClose = () => {
    this.setState({
      signinVisible: false,
    });
  };

  render() {
    const { visible,signinVisible} = this.props;
    const { getFieldDecorator } = this.props.form;
    return (
      <Drawer
        title="Login"
        width={720}
        onClose={this.props.onClose}
        visible={visible}
        bodyStyle={{ paddingBottom: 80 }}
      >
       <Form onSubmit={this.handleSubmit} className="login-form">
        <Form.Item>
          {getFieldDecorator('username', {
            rules: [{ required: true, message: 'Please input your username!' }],
          })(
            <Input
              prefix={<Icon type="user" style={{ color: 'rgba(0,0,0,.25)' }} />}
              placeholder="Username"
            />,
          )}
        </Form.Item>
        <Form.Item>
          {getFieldDecorator('password', {
            rules: [{ required: true, message: 'Please input your Password!' }],
          })(
            <Input
              prefix={<Icon type="lock" style={{ color: 'rgba(0,0,0,.25)' }} />}
              type="password"
              placeholder="Password"
            />,
          )}
        </Form.Item>
        <Form.Item>
        <Row gutter={16}>
            <Col span={3}>
          <Button type="primary" htmlType="submit">
            Log in
          </Button>
          </Col>
          <Col span={3}>
          <Button type="primary" htmlType="submit">
            Sigin Up
          </Button>
          </Col>
          </Row>
        </Form.Item>
      </Form>
      <WrappedSignin
      visible={signinVisible}
      onClose={this.onSigninClose}
    />
      </Drawer>
    );
  }
}

export const WrappedLogin = Form.create({ name: 'normal_login' })(Login);
